import React from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";

const NodeBied = ({ Component }) => {
  return <Component />;
};

NodeBied.PropTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default NodeBied;
